import React, { Component } from 'react';
import DiyList from './DiyList';
import DiyCategory from './DiyCategory';
import {
    Container,
    Col,
    Row,
    } from 'reactstrap'
class Diy extends Component{
    id = 1
    state = {
        category: '',
        information: [
            {
                id: 0,
                name: '홍길동',
                phone: '010-0000-0000'
            }
        ]
    }
    Input = () => {
        const { category } = this.state;
        this.setState({
            category: category()
        })
    }
    render(){
        return(
            <Container>
                <Row>
                    <Col align="center">
                        Image
                    </Col>
                </Row>
                <Row>
                    <Col>
                        <DiyCategory
                            onInput={this.categoryInput}
                        />
                    </Col>
                    <Col>
                        <DiyList
                            data={this.state.information}
                        />
                    </Col>
                </Row>
            </Container>

        );
    }
}

export default Diy;
